const loggedReducer = (state = true, action) => {
    switch(action.type){
        case 'LOG_IN':
            return {...state}, true;
        case 'LOG_OUT':
            return {...state}, false;
        default:
            return {...state}, false;
    }
}

export default loggedReducer;
